import static org.junit.jupiter.api.Assertions.*;

public class TFTPReadRequestPacketTest1 {

    // Step 0: Private helper method to construct a DatagramPacket with TFTP read request and options
    private DatagramPacket createDatagramPacketWithReadRequest() throws UnknownHostException {
        // Create a TFTP Read Request packet with options manually
        // Format: [opcode][filename][0][mode][0][option_name][0][option_value][0]
        byte[] data = new byte[512];
        int offset = 0;

        // Opcode for Read Request (1)
        data[offset++] = 0;
        data[offset++] = 1;

        // Filename "test.txt"
        byte[] filename = "test.txt".getBytes();
        System.arraycopy(filename, 0, data, offset, filename.length);
        offset += filename.length;
        data[offset++] = 0; // null terminator

        // Mode "octet"
        byte[] mode = "octet".getBytes();
        System.arraycopy(mode, 0, data, offset, mode.length);
        offset += mode.length;
        data[offset++] = 0; // null terminator

        // Option name "blksize"
        byte[] optionName = "blksize".getBytes();
        System.arraycopy(optionName, 0, data, offset, optionName.length);
        offset += optionName.length;
        data[offset++] = 0; // null terminator

        // Option value "1024"
        byte[] optionValue = "1024".getBytes();
        System.arraycopy(optionValue, 0, data, offset, optionValue.length);
        offset += optionValue.length;
        data[offset++] = 0; // null terminator

        // Create DatagramPacket
        return new DatagramPacket(data, offset, InetAddress.getLocalHost(), 69);
    }

    @Test
    public void testTFTPReadRequestWithOptions() throws Exception {
        // Step 7: Handle potential UnknownHostException or TFTPPacketException
        try {
            // Step 1: Invoke the helper method to construct a DatagramPacket
            DatagramPacket datagramPacket = createDatagramPacketWithReadRequest();

            // Step 2: Construct a TFTP Read Request Packet instance
            TFTPReadRequestPacket tftpReadRequestPacket = new TFTPReadRequestPacket(datagramPacket);

            // Step 3: Verify that invoking the string representation method produces a non-null result
            String packetString = tftpReadRequestPacket.toString();
            assertNotNull(packetString, "Packet string representation should not be null");

            // Step 4: Retrieve the options map from the request packet
            Map<String, String> optionsMap = tftpReadRequestPacket.getOptions();

            // Step 5: Assert that the options map contains exactly one entry
            assertEquals(1, optionsMap.size(), "Options map should contain exactly one entry");

            // Step 6: Confirm that querying the map for the "blksize" key returns "1024"
            assertEquals("1024", optionsMap.get("blksize"), "Block size option should be 1024");

        } catch (UnknownHostException e) {
            fail("UnknownHostException occurred: " + e.getMessage());
