public class TFTPReadRequestPacketTest1 {

    // Helper method to construct a properly formatted TFTP read request datagram
    private DatagramPacket createTFTPReadRequestDatagram() throws Exception {
        // Create data buffer with opcode (2 bytes), filename, null byte, mode, null byte
        byte[] data = new byte[13]; // Minimum size for "test" filename and "octet" mode

        // Set opcode for READ_REQUEST (1)
        data[0] = 0; // Opcode high byte
        data[1] = 1; // Opcode low byte (1 = READ_REQUEST)

        // Filename "test"
        byte[] filename = "test".getBytes(StandardCharsets.US_ASCII);
        System.arraycopy(filename, 0, data, 2, filename.length);
        data[2 + filename.length] = 0; // null terminator

        // Mode "octet"
        byte[] mode = "octet".getBytes(StandardCharsets.US_ASCII);
        System.arraycopy(mode, 0, data, 2 + filename.length + 1, mode.length);
        data[2 + filename.length + 1 + mode.length] = 0; // null terminator

        return new DatagramPacket(data, data.length, InetAddress.getByName("localhost"), 69);
    }

    @Test
    public void testDatagramReconstruction() throws Exception {
        // Step 1: Invoke the helper method to obtain an initial datagram packet
        DatagramPacket originalDatagram = createTFTPReadRequestDatagram();

        // Step 2: Construct a TFTP Read Request Packet instance by parsing the initial datagram
        TFTPReadRequestPacket tftpReadRequestPacket;
        try {
            tftpReadRequestPacket = new TFTPReadRequestPacket(originalDatagram);
        } catch (TFTPPacketException e) {
            fail("Failed to construct TFTPReadRequestPacket: " + e.getMessage());
            return;
        }

