        DatagramPacket reconstructedDatagram = tftpReadRequestPacket.newDatagram();

        // Step 4: Verify that the reconstructed datagram is not null
        assertNotNull(reconstructedDatagram, "Reconstructed datagram should not be null");

        // Step 5: Assert that the reconstructed datagram's network address matches the original datagram's address
        assertEquals(originalDatagram.getAddress(), reconstructedDatagram.getAddress(), 
            "Reconstructed datagram address should match original");

        // Step 6: Assert that the reconstructed datagram's port matches the original datagram's port
        assertEquals(originalDatagram.getPort(), reconstructedDatagram.getPort(), 
            "Reconstructed datagram port should match original");

        // Step 7: Assert that the reconstructed datagram's length matches the original datagram's length
        assertEquals(originalDatagram.getLength(), reconstructedDatagram.getLength(), 
            "Reconstructed datagram length should match original");

        // Step 8: Assert that the reconstructed datagram's byte data matches the original datagram's byte data
        assertArrayEquals(originalDatagram.getData(), reconstructedDatagram.getData(), 
            "Reconstructed datagram data should match original");

        // Step 9: Allocate a byte array sized to match the original datagram's length
        byte[] byteBuffer = new byte[originalDatagram.getLength()];

        // Step 10: Construct a new datagram packet targeting localhost with the byte buffer
        DatagramPacket newDatagramPacket = new DatagramPacket(byteBuffer, byteBuffer.length, 
            InetAddress.getByName("localhost"), 0);

        // Step 11: Invoke the two-parameter newDatagram method on the request packet
        // (No try-catch needed as this method doesn't throw TFTPPacketException)
        DatagramPacket secondReconstructedDatagram = tftpReadRequestPacket.newDatagram(newDatagramPacket, byteBuffer);

