package org.apache.commons.net.tftp;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class TFTPClientBufferResizeTest {

    @Test
    public void testBufferResizing() {
        // Step 0: Instantiate TFTPClient in a try-with-resources block
        try (TFTPClient tftpClient = new TFTPClient()) {
            // Step 1: Call resetBuffersToSize(512) on the client
            tftpClient.resetBuffersToSize(512);

            // Step 2: Retrieve packet size using getPacketSize()
            int packetSize = tftpClient.getPacketSize();

            // Step 3: Assert that packet size equals 516 (512 + 4-byte TFTP header)
            assertEquals(516, packetSize, "Packet size should be 512 bytes data + 4 bytes header");
        }
    }
}

package org.apache.commons.net.tftp;

import org.junit.jupiter.api.AfterEach;
import org.junit.jupiter.api.BeforeAll;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertEquals;
import java.io.File;
import java.io.IOException;
import java.net.URL;

public class TFTPClientBufferResizeTest {

    // Static fields as required
    private static final int SERVER_PORT = 6969;
    private static TFTPServer tftpS;
    private static File SERVER_DIR;
    private static final String FILE_PREFIX = "test";
    private static File[] FILES;
    private static int testsLeftToRun = 1;

    @BeforeAll
    public static void setUp() throws IOException {
        // Create temporary directory and assign to SERVER_DIR
        SERVER_DIR = new File(System.getProperty("java.io.tmpdir"), "tftp_test");
        SERVER_DIR.mkdirs();

        // Initialize FILES array with test file paths
        FILES = new File[1];
        FILES[0] = new File(SERVER_DIR, FILE_PREFIX + ".txt");
        FILES[0].createNewFile();
    }

    @Test
    public void testBufferResizing() throws IOException {
        // Instantiate TFTPClient using try-with-resources
        try (TFTPClient tftp = new TFTPClient()) {
            // Declare bufferSize variable with value 1024
            int bufferSize = 1024;

            // Invoke resetBuffersToSize on tftp passing bufferSize
            tftp.resetBuffersToSize(bufferSize);

            // Assert getPacketSize on tftp equals bufferSize + 4 with message
            assertEquals(bufferSize + 4, tftp.getPacketSize(), "Packet size should be 1028");
        }
    }

    @AfterEach
    public void tearDown() {
        // Decrement testsLeftToRun counter
        testsLeftToRun--;

        // Check if testsLeftToRun is less than or equal to 0
        if (testsLeftToRun <= 0) {
            // Verify tftpS is not null
            if (tftpS != null) {
                // Invoke close on tftpS
                tftpS.close();
            }

            // Iterate over FILES array and delete each file
            if (FILES != null) {
                for (File file : FILES) {
                    file.delete();
                }
            }
        }
    }
}
